style.css:
style {
  background-color: hsla(0, 0%, 100%, 1);
  background-image: radial-gradient(at 98% 56%, hsla(259, 100%, 92%, 1) 0px, transparent 50%),
    radial-gradient(at 37% 56%, hsla(279, 100%, 89%, 1) 0px, transparent 50%),
    radial-gradient(at 87% 89%, hsla(278, 100%, 53%, 1) 0px, transparent 50%),
    radial-gradient(at 0% 0%, hsla(328, 100%, 53%, 1) 0px, transparent 50%);
}
